import './index.css'
import {Animator, batch, Fade, ScrollContainer, ScrollPage, Sticky, Zoom} from 'react-scroll-motion';
import React from 'react';


function SkillsCertificates(){
  return (
    <ScrollContainer>
      <ScrollPage page = {0}>
        <Animator animation = {batch(Sticky(), Fade(0))}>
          <h2>Let me show you a scroll animation</h2>
        </Animator>
      </ScrollPage>
      <ScrollPage page = {1}>
        <Animator animation = {Zoom()}>
          <h4>I'm Fade Up Scroll Out !</h4>
        </Animator>
      </ScrollPage>
    </ScrollContainer>
  )

}
export default SkillsCertificates;
